import React from "react";
import { makeStyles } from '@material-ui/core/styles'
import { Typography } from "@material-ui/core";

const useStyle = makeStyles(theme =>({
    video: {
        backgrounImage: "url('https://cdn.dribbble.com/users/1568450/screenshots/5996914/teamwork_12.png')",
        height: 700,
        display: 'block',
        margin: '0 auto'
    },
    text: {
        textAlign: 'center'
    }
}))

export default function PreviewLoader(props) {
  const classes = useStyle()
  return (
    <div>
      <video
        id="video"
        playsinline="true"
        muted="true"
        autoplay="true"
        loop="true"
        className={classes.video}
        data-silent="true"
        src="https://cdn.dribbble.com/users/1568450/videos/12771/teamwork_12.mp4"
      />
      <Typography className={classes.text} variant='h4'>Please wait... Generating preview!</Typography>
    </div>
  );
}
